import React, { Component } from "react";
import { Row, Col } from "antd";
import { Input } from "antd";
import { UserOutlined } from "@ant-design/icons";

export default class UserForm extends Component {
  render() {
    return (
      <>
        <Row gutter={[48, 48]}>
          <Col span={12}>
            
            <Input
              size="large"
              placeholder="large size"
              prefix={<UserOutlined />}
            />
          </Col>
          <Col span={12}></Col>
          <Col span={12}>  <Input
              size="large"
              placeholder="large size"
              prefix={<UserOutlined />}
            /></Col>
          <Col span={12}>c</Col>
          <Col span={12}>  <Input
              size="large"
              placeholder="large size"
              prefix={<UserOutlined />}
            /></Col>
        </Row>
      </>
    );
  }
}
